import jumbo from './images/jumbo.jpg';
import MedOntology from './images/MedOntology.png';
import Map from './images/map.jpg';
import Flashcard from './images/flashcards.jpg';

export default[
    {
        id: 1,
        title: "Medical Ontology",
        image: MedOntology,
        description: 
        "Ontologies are widely used tools in medical research. An ontology can be described as a wide array of "
        +"data of the same domain that is organized as classes and relations. Usually, ontologies are represented "
        +"in 2-D models. "
        +"The Medical Ontology research project focuses on creating a 3-D model of a medical "
        +"ontology. I worked on this project under Dr. Margartia Vinnikov at the MIXR Lab at the "
        +"New Jersey Institute of Technology. Future plans for this project are to present it at the Fall 2020 "
        +"Undergraduate Research and Innovation (URI) Seed Program. "
        ,
        source: "https://git.njit.edu/ew84/MedicalOntologyProject"
    },
    {
        id: 2,
        title: "Communimap",
        image: Map,
        description: "This is not a project.",
        source: "https://github.com/ewangso/Communimap"
    },
    {
        id: 3,
        title: "Flashcard App",
        image: Flashcard,
        description: "This is a good project.",
        source: "https://github.com/ewangso/FlashcardApp"
    }
]
